#include <iostream>
using namespace std;

bool checkUnique(string s,int length){
  for (int i=0;i<length;i++){
    for (int j=i+1;j<length;j++){
      if (s[i] == s[j]){
        return false;
        
      }
    }
  }
  return true;
}

int main(){
  string data = "";
  for (int i=3;i<data.length();i++){
    string substr = data.substr(i-3,4);
    bool unique = checkUnique(substr,4);
    if (unique==true){
      cout<<i+1<<endl;
      break;
    }
  }
}
